window.bookSummaryJSON = "<p>I’m the girl who no one wanted. Or the one who got away. Depending on who you ask.&nbsp;&nbsp;</p> <p>Either way, betrayal and heartache have been my friends for far too long and it’s time for me to start over.&nbsp;</p> <p>I gave the Harlequin boys a chance to change. A chance to prove that history wasn’t just set to repeat itself. But they failed with spectacular colors.&nbsp;</p> <p>Maybe it’s time for me to stop running. After all, Sunset Cove has been living under the Harlequins’ thumb for far too long. It’s time to set our demons free and let them burn this place to the ground. Who knows if I’ll survive the fallout?&nbsp;</p> <p>But I guess I’ll soon find out if dead girls can die twice.&nbsp;&nbsp;</p> <p>This is an enemies to lovers contemporary series where the girl will end up with multiple love interests and all of the characters are in their late-20s. Trigger warning: This series features gangs, violence, dark romance and jealous/possessive themes.</p>"; 
